import React, { Component } from 'react';

export default class Contact extends Component {
    constructor(props){
        super(props);
        this.state = {
            passphrase: ''
        }
    }

    onChange = (e) => {
        let target = e.target;
        this.setState({ passphrase: target.value })
    }

    render() {
        return (
            <div className="primary col-8">
                <form id="authenticate">
                    <div className="form-group rounded">
                        <label htmlFor="authenticate" value="authenticate">Passphrase</label>
                        <input onChange={this.onChange} className="form-control" type="text" name="name" id="project-name" />
                    </div>
                    <div className="form-group rounded text-right" id="btn-control">
                        <button onClick={props.onClick} className="btn btn-primary" value="Add Project" id="project-submit">Authenitcate</button>
                    </div>
                </form>
            </div>
        )
    }
}
